import './stylesheets/App.css';
import FakeStackOverflow from './components/fakestackoverflow.js'
import React from 'react';
import { UserProvider } from './components/UserContext.js';

function App() {
  return (
    <UserProvider> 
      <section className="fakeso">
        <FakeStackOverflow />
      </section>
    </UserProvider>
  );
}

export default App;
